import React from 'react';

export default function TopArtistsBoard ({items}) {

    createTable = () =>  {
        return items.map((item, index) =>{
            const {idx, name, popularity} = item
            return (
                <tr key={idx}>
                    <td>{idx}</td>
                    <td>{name}</td>
                    <td>{popularity}</td>

                </tr>
            )
        })
    }

    return (
        <div>
            <h1 id="top_artists_table">Top Artists</h1>
            <table id="artists_table">
                <tbody>


                </tbody>

            </table>

        </div>
    );
}
